webpackJsonp([32,262],{3:function(e,t){e.exports="data:image/png;base64,"},10:function(e,t){e.exports="data:image/png;base64,"},27:function(e,t){e.exports="data:image/png;base64,"},198:function(e,t,r){e.exports=r.p+"_/tjesi_oppgaver/src/scratch/straffespark/straffespark.954087.png"},1078:function(e,t,r){e.exports={frontmatter:r(459),content:r(1681)}},1681:function(e,t,r){e.exports="<section class=intro id=introduksjon> <h1 class=intro id=introduksjon>Introduksjon</h1> <figure>Vi skal lage et enkelt fotballspill, hvor du skal prøve å score på så mange straffespark som mulig.</figure> <figure><img src="+r(198)+' alt=""/></figure> </section> <section class=activity id=steg-1-katten-og-fotballbanen> <h1 class=activity id=steg-1-katten-og-fotballbanen>Steg 1: Katten og fotballbanen</h1> <figure><em>Vi begynner med å lage en katt som kan bevege seg på en fotballbane.</em></figure> <section class=check id=sjekkliste> <h2 class=check id=sjekkliste>Sjekkliste</h2> <ul> <li> <p>Start et nytt prosjekt, for eksempel ved å klikke <code>Programmering</code> i menyen. Hvis du allerede har startet et prosjekt kan du begynne på et nytt ved å velge <code>Fil</code> og deretter <code>Ny</code>.</p> </li> <li> <p>Klikk på <code class=blockmotion>i</code> i hjørnet av kattefiguren, og gi katten navnet <code>Leo</code>.</p> </li> <li> <p>Klikk på <img src='+r(27)+' alt="Velg ny bakgrunn"/> nederst til venstre på skjermen for å hente inn en ny bakgrunn. Velg bakgrunnen <code>Utendørs/goal1</code> eller <code>Utendørs/goal2</code>.</p> </li> <li> <p>Vi skal nå skrive et lite program som flytter katten <code>Leo</code> når vi klikker på ham. Merk <code>Leo</code> i figurvinduet nederst på skjermen, og klikk <code>Skript</code>-fanen slik at du ser de forskjellige kommandoklossene igjen. Pusle deretter sammen de følgende klossene i skriptvinduet til høyre:</p> <pre class=blocks>når denne figuren klikkes\ngå (10) steg\n</pre> </li> </ul> </section> <section class=flag id=test-prosjektet> <h2 class=flag id=test-prosjektet>Test prosjektet</h2> <figure><strong>Klikk på det grønne flagget.</strong></figure> <ul> <li> <figure>Flytter <code>Leo</code> på seg når du klikker på ham?</figure> </li> <li> <p>Hva skjer om du klikker mange ganger på <code>Leo</code> slik at han når bort til kanten av scenen?</p> </li> </ul> </section> <section class=check id=sjekkliste-2> <h2 class=check id=sjekkliste-2>Sjekkliste</h2> <ul> <li> <p>Du kan flytte <code>Leo</code> tilbake på skjermen ved å trykke på ham og dra ham dit du vil.</p> </li> <li> <p>Vi vil likevel programmere en enklere måte å få <code>Leo</code> tilbake på banen på. Lag et <strong>nytt</strong> skript, <strong>ved siden av</strong> det du allerede har laget, som ser slik ut:</p> <pre class=blocks>når grønt flagg klikkes\ngå til x: (-180) y: (-30)\n</pre> </li> <li> <p>Nå vil <code>Leo</code> komme tilbake på banen hver gang du klikker det grønne flagget rett over scenen.</p> </li> </ul> </section> <section class=save id=lagre-prosjektet> <h2 class=save id=lagre-prosjektet>Lagre prosjektet</h2> <p>Du har nå skrevet et lite program! Scratch lagrer alt du gjør med jevne mellomrom. Det er likevel en god vane å lagre selv også innimellom.</p> <ul> <li> <p>Over scenen er det et tekstfelt hvor du kan gi et navn til spillet ditt. Kall det for eksempel <code>Straffespark</code>.</p> </li> <li> <p>I menyen <code>Fil</code> kan du velge <code>Lagre nå</code> for å lagre prosjektet.</p> </li> </ul> </section> </section> <section class=activity id=steg-2-vi-sparker-ballen> <h1 class=activity id=steg-2-vi-sparker-ballen>Steg 2: Vi sparker ballen</h1> <figure><em>Det neste vi trenger i spillet vårt er en ball!</em></figure> <section class=check id=sjekkliste-3> <h2 class=check id=sjekkliste-3>Sjekkliste</h2> <ul> <li> <p>Vi skal nå legge til en ball-figur i spillet vårt. Klikk på <img src='+r(3)+' alt="Velg figur fra biblioteket"/> og velg fotballen <code>Ting/Soccer Ball</code>.</p> </li> <li> <figure>Gi fotballen navnet <code>Ball</code>.</figure> </li> <li> <p>Lag ballen mindre ved først å trykke på <img src='+r(10)+" alt=krymp /> øverst mot midten av vinduet. Deretter kan du trykke på ballen seks ganger.</p> </li> <li> <p>Vi skal nå skrive et litt lengre program. I dette programmet legger vi først fotballen på plass foran katten. Etter at ballen berører <code>Leo</code> (det vil si <code>Leo</code> sparker ballen) begynner ballen å bevege seg. Se om du kjenner igjen hvor i programmet de forskjellige tingene skjer:</p> <pre class=blocks>når grønt flagg klikkes\ngå til x: (-125) y: (-60)\nvent til &lt;berører [Leo v]?&gt;\nfor alltid\n    gå (6) steg\nslutt\n</pre> </li> </ul> </section> <section class=flag id=test-prosjektet-2> <h2 class=flag id=test-prosjektet-2>Test prosjektet</h2> <figure><strong>Klikk på det grønne flagget.</strong></figure> <ul> <li> <figure>Sparker <code>Leo</code> ballen når du klikker på ham?</figure> </li> <li> <p>Kan <code>Leo</code> sparke ballen en gang til dersom du trykker det grønne flagget igjen?</p> </li> <li> <p>Hvis <code>Leo</code> sparker ballen før du klikker på ham (med en gang du trykker det grønne flagget), så må du endre litt på tallene i <code class=b>gå til x: () y: ()</code>-klossen slik at ballen ligger i ro foran <code>Leo</code>.</p> </li> </ul> </section> </section> <section class=activity id=steg-3-vi-trenger-en-keeper> <h1 class=activity id=steg-3-vi-trenger-en-keeper>Steg 3: Vi trenger en keeper!</h1> <figure><em>Vi skal nå gjøre spillet litt vanskeligere ved å programmere en keeper.</em></figure> <section class=check id=sjekkliste-4> <h2 class=check id=sjekkliste-4>Sjekkliste</h2> <ul> <li> <p>Legg til en figur til som kan være keeper. Vi har brukt <code>Dyr/Octopus</code>, men du kan også bruke en annen figur om du vil.</p> </li> <li> <p>Flytt figuren inn i målet. Om det ser ut som figuren står med ryggen til ballen kan du snu den på følgende måte: Klikk på <code>Drakter</code>-fanen, og deretter på snu-knappen som er merket med rødt i figuren under.</p> <figure><img src="+r(2337)+' alt=""/></figure> </li> <li> <figure>Gi figuren navnet <code>Keeper</code>.</figure> </li> <li> <p>Lag det følgende programmet for keeperen:</p> <pre class=blocks>når grønt flagg klikkes\ngå til x: (100) y: (-50)\npek i retning (0 v)\nfor alltid\n    gå (15) steg\n    sprett tilbake ved kanten\nslutt\n</pre> <figure>Det er et par nye klosser i dette skriptet. Les programmet nøye. Hva tror du de nye klossene gjør?</figure> </li> </ul> </section> <section class=flag id=test-prosjektet-3> <h2 class=flag id=test-prosjektet-3>Test prosjektet</h2> <figure><strong>Klikk på det grønne flagget.</strong></figure> <ul> <li> <p>Starter keeperen i målet?</p> </li> <li> <figure>Beveger <code>Keeper</code> seg opp og ned på skjermen?</figure> </li> </ul> </section> <section class=check id=sjekkliste-5> <h2 class=check id=sjekkliste-5>Sjekkliste</h2> <ul> <li> <p>En ting som ser litt rart ut er at <code>Keeper</code> ikke ser på ballen. Vi fikser dette ved å legge til en <code class=b>begrens rotasjon [vend sideveis v]</code>-kloss helt i begynnelsen av skriptet vårt.</p> </li> <li> <p>Du synes kanskje at keeperen er litt stor? Vi har tidligere sett hvordan vi kan bruke <img src='+r(10)+" alt=krymp /> for å gjøre figurer mindre. En annen måte å endre størrelsen på er ved å bruke klosser fra <code class=blocklooks>Utseendet</code>-kategorien.</p> <p>Legg klossen <code class=b>sett størrelse til (100)%</code> inn i <code class=blockcontrol>for alltid</code>-løkka. Du kan nå eksperimentere med å endre <code>100%</code> til et annet tall til du finner en passende størrelse på keeperen. Om du har brukt blekkspruten som <code>Keeper</code> passer <code>50%</code> ganske bra. Prøv deg frem!</p> </li> </ul> </section> <section class=flag id=test-prosjektet-4> <h2 class=flag id=test-prosjektet-4>Test prosjektet</h2> <figure><strong>Klikk på det grønne flagget.</strong></figure> <ul> <li> <figure>Ser keeperen i retning av <code>Leo</code> og ballen?</figure> </li> <li> <p>Hva skjer etter at katten skyter mot mål? Kan keeperen redde ballen?</p> </li> </ul> </section> </section> <section class=activity id=steg-4-keeperen-redder> <h1 class=activity id=steg-4-keeperen-redder>Steg 4: Keeperen redder!</h1> <figure><em>Nå er det på tide at keeperen redder ballen!</em></figure> <figure>Vi skal nå lage noen tester som sier i fra når keeperen redder ballen, eller når ballen går i mål.</figure> <section class=check id=sjekkliste-6> <h2 class=check id=sjekkliste-6>Sjekkliste</h2> <ul> <li> <p>Vi begynner med å finne ut når keeperen redder ballen. Klikk på <code>Ball</code>. Legg til en <code class=blockcontrol>hvis ellers</code>-kloss i skriptet slik:</p> <pre class=blocks>når grønt flagg klikkes\ngå til x: (-125) y: (-60)\nvent til &lt;berører [Leo v]?&gt;\nfor alltid\n    gå (6) steg\n    hvis &lt;berører [Keeper v]?&gt;\n        send melding [Redning v]\n    ellers\n    slutt\nslutt\n</pre> <p>I klossen <code class=b>send melding [message1 v]</code> må du velge <code>Ny melding</code> og deretter skrive inn <code>Redning</code> som meldingsnavn.</p> </li> </ul> <p>Meldinger er beskjeder som figurene i spillet kan sende seg i mellom uten at du egentlig ser det. Disse gjør det lett for flere figurer å reagere på ting som skjer.</p> <ul> <li> <p>Vi vil nå at både ballen og keeperen skal slutte å bevege seg ved en redning. Legg til dette som et nytt skript på både <code>Ball</code> og <code>Keeper</code>:</p> <pre class=blocks>når jeg mottar [Redning v]\nstopp [andre skript i figuren v] :: control\n</pre> <p>Et triks er å først skrive denne koden for <code>Ball</code>. Deretter kan du kopiere den til <code>Keeper</code> ved å dra koden til <code>Keeper</code>-figuren i figurvinduet nederst på skjermen.</p> </li> </ul> </section> <section class=flag id=test-prosjektet-5> <h2 class=flag id=test-prosjektet-5>Test prosjektet</h2> <figure><strong>Klikk på det grønne flagget.</strong></figure> <ul> <li>Slutter både ballen og keeperen å bevege seg om keeperen redder?</li> </ul> </section> <section class=check id=sjekkliste-7> <h2 class=check id=sjekkliste-7>Sjekkliste</h2> <p>Nå skal vi også sjekke om ballen har gått i mål. Vi gjør dette ved å undersøke hvor langt til høyre på skjermen ballen har beveget seg. Posisjonen til en figur i Scratch er beskrevet ved hjelp av koordinater: <code class=b>(x-posisjon)</code> sier hvor en figur er sidelengs på skjermen, mens <code class=b>(y-posisjon)</code> sier hvor langt opp eller ned på skjermen en figur er. Rett under scenen kan du se to tall merket <code>x</code> og <code>y</code>. Disse viser koordinatene til musepekeren.</p> <figure><img src="+r(2336)+' alt=""/></figure> <ul> <li> <p>Vi sier at det har blitt mål om ballen går langt nok til høyre uten at den blir reddet. Om du prøver å peke på målstangen med musepekeren ser du at den står omtrent ved <code>x</code> lik 160. Utvid skriptet på ballen videre slik at det blir seende slik ut:</p> <pre class=blocks>når grønt flagg klikkes\ngå til x: (-125) y: (-60)\nvent til &lt;berører [Leo v]?&gt;\nfor alltid\n    gå (6) steg\n    hvis &lt;berører [Keeper v]?&gt;\n        send melding [Redning v]\n    ellers\n        hvis &lt;(x-posisjon) &gt; [160]&gt;\n            send melding [Mål v]\n        slutt\n    slutt\nslutt\n</pre> </li> <li> <p>På samme måte som for redning kan vi avslutte bevegelsen til <code>Ball</code> og <code>Keeper</code> ved å lage dette skriptet på begge figurene:</p> <pre class=blocks>når jeg mottar [Mål v]\nstopp [andre skript i figuren v] :: control\n</pre> </li> <li> <p>Vi kan også la <code>Leo</code> juble litt når han scorer mål. Klikk på kattefiguren og gi ham følgende skript:</p> <pre class=blocks>når jeg mottar [Mål v]\nsi [Ja, det ble mål!!] i (2) sekunder\n</pre> </li> <li> <p>Lag et tilsvarende skript der <code>Leo</code> sier noe om at han er lei seg om det blir en <code>Redning</code>. Prøv dette på egen hånd!</p> </li> </ul> </section> <section class=flag id=test-prosjektet-6> <h2 class=flag id=test-prosjektet-6>Test prosjektet</h2> <figure><strong>Klikk på det grønne flagget.</strong></figure> <ul> <li> <p>Klarer du å score mål?</p> </li> <li> <p>Klarer keeperen å redde noen skudd?</p> </li> </ul> </section> <section class=protip id=endre-farten> <h2 class=protip id=endre-farten>Endre farten</h2> <p>Du kan gjøre spillet enklere eller vanskeligere ved å endre farten på ballen og hvor fort keeperen beveger seg. Begge disse er bestemt av tallet som står i <code class=b>gå () steg</code>-klossene til henholdsvis <code>Ball</code> og <code>Keeper</code>.</p> <p>Prøv forskjellige tall for både fotballen og keeperen til du finner den kombinasjonen du liker best. Pass på at det blir litt vanskelig, men ikke umulig.</p> </section> </section> <section class=activity id=steg-5-forstemann-til-10> <h1 class=activity id=steg-5-forstemann-til-10>Steg 5: Førstemann til 10!</h1> <p><em>Vi skal tilslutt se på hvordan vi kan telle hvor mange mål som scores.</em></p> <section class=check id=sjekkliste-8> <h2 class=check id=sjekkliste-8>Sjekkliste</h2> <p>For å telle hvor mange mål du har scoret, og hvor mange redninger <code>Keeper</code> har gjort, skal vi bruke <em>variabler</em>.</p> <ul> <li> <p>Klikk på scenen til venstre for figurlisten.</p> </li> <li> <p>Klikk på <code class=blockdata>Data</code>-kategorien og lag en ny variabel. Gi den nye variabelen navnet <code>Mål</code>. Legg merke til at det dukket opp en ny boks på scenen som er merket <code>Mål</code>, og som viser tallet <code class=blockdata>0</code>.</p> </li> <li> <p>Vi vil nå telle målene. Lag et nytt skript som endrer <code class=b>(Mål)</code> hver gang meldingen <code>Mål</code> sendes, ved å lage dette skriptet på Scenen:</p> <pre class=blocks>når jeg mottar [Mål v]\nendre [Mål v] med (1)\n</pre> </li> <li> <p>Vi kan gjøre tilsvarende for å telle antall redninger. Lag en ny variabel som heter <code class=b>(Redninger)</code>.</p> </li> <li> <p>Lag deretter et nytt skript for å telle redningene:</p> <pre class=blocks>når jeg mottar [Redning v]\nendre [Redninger v] med (1)\n</pre> </li> </ul> </section> <section class=flag id=test-prosjektet-7> <h2 class=flag id=test-prosjektet-7>Test prosjektet</h2> <figure><strong>Klikk på det grønne flagget.</strong></figure> <ul> <li> <p>Teller spillet hver gang du scorer mål?</p> </li> <li> <p>Telles også hvor mange redninger keeperen gjør?</p> </li> </ul> </section> <section class=check id=sjekkliste-9> <h2 class=check id=sjekkliste-9>Sjekkliste</h2> <p>Avslutningsvis vil vi legge inn en test på om <code>Leo</code> klarer å score 10 mål eller <code>Keeper</code> klarer å redde 10 ganger. Dette er litt omfattende.</p> <ul> <li> <p>Først vil vi lage to nye bakgrunner, en vi kan bruke om spilleren vinner (katten scorer 10 ganger) og en vi bruker om spilleren taper (keeperen redder 10 ganger). Klikk på <code>Bakgrunner</code>-fanen. Høyreklikk på den lille versjonen av bakgrunnen din midt på skjermen og velg <code>Lag en kopi</code>.</p> </li> <li> <p>Velg en passende farge, og klikk deretter på tekstverktøyet. Velg Skrifttype: <code>Marker</code> nederst på skjermen. Skriv en tekst som ligner på <code>Gratulerer, du vant!</code> litt høyt på kopien av bakgrunnen. Gi denne bakgrunnen navnet <code>Seier</code>.</p> </li> <li> <p>Lag deretter en ny kopi av den originale bakgrunnen. Kall denne bakgrunnen <code>Tap</code> og skriv også her en passende tekst.</p> </li> <li> <figure>Lag et skript på bakgrunnen som setter variabelene dine til 0 ved begynnelsen av spillet.</figure> <pre class=blocks>når grønt flagg klikkes\nsett [Mål v] til [0]\nsett [Redninger v] til [0]\nbytt bakgrunn til [goal1]\nsend melding [Nytt spark v]\n</pre> </li> <li> <p>Vi vil nå spille uten at vi må klikke på det grønne flagget for hver gang vi skal skyte et straffespark. Til dette bruker vi meldingen <code>Nytt spark</code>. Vi må nå bytte ut</p> <pre class=blocks>når grønt flagg klikkes\n</pre> <p>med</p> <pre class=blocks>når jeg mottar [Nytt spark v]\n</pre> <p>på både <code>Leo</code>, <code>Ball</code> og <code>Keeper</code>. For eksempel, på <code>Leo</code> blir skriptet seende slik ut:</p> <pre class=blocks>når jeg mottar [Nytt spark v]\ngå til x: (-180) y: (-30)\n</pre> </li> <li> <p>Til slutt legger vi på testen om vi har scoret 10 mål, eller om keeperen har reddet 10 ganger. Endre <code>Mål</code>-skriptet på scenen slik at det blir seende slik ut:</p> <pre class=blocks>når jeg mottar [Mål v]\nendre [Mål v] med (1)\nvent (2) sekunder\nhvis &lt;(Mål) &lt; [10]&gt;\n    send melding [Nytt spark v]\nellers\n    bytt bakgrunn til [Seier v]\n    stopp [alle v] :: control\nslutt\n</pre> </li> <li> <figure>På samme måte endrer du <code>Redning</code>-skriptet på scenen:</figure> <pre class=blocks>når jeg mottar [Redning v]\nendre [Redninger v] med (1)\nvent (2) sekunder\nhvis &lt;(Redninger) &lt; [10]&gt;\n    send melding [Nytt spark v]\nellers\n    bytt bakgrunn til [Tap v]\n    stopp [alle v] :: control\nslutt\n</pre> </li> </ul> </section> <section class=flag id=test-prosjektet-8> <h2 class=flag id=test-prosjektet-8>Test prosjektet</h2> <figure><strong>Klikk på det grønne flagget.</strong></figure> <ul> <li> <figure>Får du skyte flere straffespark uten å måtte trykke på det grønne flagget mellom hver gang?</figure> </li> <li> <p>Bytter spillet til riktig bakgrunn om du scorer 10 mål?</p> </li> <li> <p>Bytter spillet til riktig bakgrunn om keeperen redder 10 ganger?</p> </li> <li> <p>Nullstilles målene og redningene når du klikker det grønne flagget?</p> </li> </ul> </section> <section class=protip id=lydeffekter> <h2 class=protip id=lydeffekter>Lydeffekter</h2> <p>Du kan legge lydeffekter på spillet ditt ved å bruke klossene under <code class=blocksound>Lyd</code>-kategorien. Prøv for eksempel å legge på lyder når ballen sparkes, når keeperen redder eller når det blir mål.</p> <p>For å finne flere lyder å bruke i spillet ditt kan du velge <code>Lyder</code>-fanen. Her kan du hente flere lyder fra Scratch-biblioteket eller til og med ta opp egne lyder. Eksperimenter og prøv deg frem!</p> </section> <section class=save id=lagre-spillet> <h2 class=save id=lagre-spillet>Lagre spillet</h2> <figure>Da er vi ferdige med Straffespark! Om du har noen ideer til hvordan du kan gjøre spillet enda morsommere så prøv dem selv!</figure> <p>Om du klikker <code>Legg ut</code> vil prosjektet ditt bli lagt ut på Scratch-hjemmesiden slik at andre kan spille det!</p> </section> </section>'},2336:function(e,t,r){e.exports=r.p+"_/tjesi_oppgaver/src/scratch/straffespark/koordinater.63b329.png"},2337:function(e,t,r){e.exports=r.p+"_/tjesi_oppgaver/src/scratch/straffespark/snu_figur.b3a229.png"}});